import React, { useContext, useEffect, useState } from 'react';
import { AuthContext } from '../context/AuthContext';
import { rentalService } from '../services/rentalService';
import { BackButton } from '../components/layout/BuckButton';

export const RentalsPage: React.FC = () => {
  const [rentals, setRentals] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [returning, setReturning] = useState<string | null>(null);
  const { user } = useContext(AuthContext) || {};

  useEffect(() => {
    fetchRentals();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  const fetchRentals = async () => {
    try {
      setLoading(true);
      const data = await rentalService.getUserRentals((user as any)?.id);
      setRentals(data);
    } catch (err: any) {
      setError(err.response?.data?.message || 'Failed to fetch rentals');
    } finally {
      setLoading(false);
    }
  };

  const handleReturn = async (rentalId: string) => {
    try {
      setReturning(rentalId);
      await rentalService.returnRental(rentalId);
      alert('Book returned successfully!');
      fetchRentals();
    } catch (err: any) {
      alert(err.response?.data?.message || 'Failed to return book');
    } finally {
      setReturning(null);
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="text-xl text-gray-600">Loading rentals...</div>
      </div>
    );
  }

  const activeRentals = rentals.filter((r) => r.status === 'active');
  const returnedRentals = rentals.filter((r) => r.status === 'returned');

  return (
    <div className="container mx-auto px-4 py-8">
      <BackButton to="/dashboard" />

      <h1 className="text-4xl font-bold text-gray-800 mb-8">ðŸŽ« My Rentals</h1>

      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      {/* Active Rentals */}
      <div className="mb-12">
        <h2 className="text-2xl font-bold text-gray-800 mb-4">Active Rentals</h2>
        {activeRentals.length === 0 ? (
          <p className="text-gray-600">No active rentals</p>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {activeRentals.map((rental) => (
              <div key={rental._id} className="bg-white rounded-lg shadow-md p-6">
                <h3 className="text-xl font-bold text-gray-800 mb-2">
                  {rental.bookId?.title || 'Book'}
                </h3>
                <p className="text-gray-600 mb-1">
                  <strong>Author:</strong> {rental.bookId?.author}
                </p>
                <p className="text-gray-600 mb-1">
                  <strong>Rented on:</strong>{' '}
                  {new Date(rental.rentedAt).toLocaleDateString()}
                </p>
                <p className="text-gray-600 mb-1">
                  <strong>Due on:</strong>{' '}
                  {new Date(rental.dueAt).toLocaleDateString()}
                </p>
                <button
                  onClick={() => handleReturn(rental._id)}
                  disabled={returning === rental._id}
                  className="w-full bg-green-500 hover:bg-green-600 disabled:opacity-50 text-white font-bold py-2 px-4 rounded mt-4"
                >
                  {returning === rental._id ? 'Returning...' : 'Return Book'}
                </button>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Returned Rentals */}
      <div>
        <h2 className="text-2xl font-bold text-gray-800 mb-4">Rental History</h2>
        {returnedRentals.length === 0 ? (
          <p className="text-gray-600">No returned rentals</p>
        ) : (
          <div className="space-y-3">
            {returnedRentals.map((rental) => (
              <div
                key={rental._id}
                className="bg-gray-50 rounded-lg p-4 border-l-4 border-green-500"
              >
                <div className="flex justify-between items-start">
                  <div>
                    <h3 className="font-bold text-gray-800">
                      {rental.bookId?.title || 'Book'}
                    </h3>
                    <p className="text-gray-600 text-sm">
                      Rented: {new Date(rental.rentedAt).toLocaleDateString()} | Returned:{' '}
                      {new Date(rental.returnedAt).toLocaleDateString()}
                    </p>
                  </div>
                  <span className="bg-green-200 text-green-800 px-3 py-1 rounded-full text-sm font-semibold">
                    Returned
                  </span>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};
